import React from "react";
import { BrowserRouter, Route } from "react-router-dom";

const home = () => {
  return (
    <div>
      <h1>Home</h1>
    </div>
  );
};

const About = () => {
  return (
    <div>
      <h1>About</h1>
    </div>
  );
};

const App = () => {
  return (
    <BrowserRouter>
      <React.Fragment>
        <Route path="/" exact component={home} />
        <Route path="/about" exact component={About} />
      </React.Fragment>
    </BrowserRouter>
  );
};

export default App;
